import { useEffect, useState } from 'react';
import getData from './services/api';
import '../styles/App.scss';


function App() {

const [characterList, setCharacterList] = useState([]);

  useEffect( () => {
    getData ()
      .then((cleanData) => {
        setCharacterList(cleanData);
      });
  },[]);
  return <div>Rick & Morty</div>;
}


export default App;
